function Pesquisar(e){jQuery.ajax({url:pesquisaURL,method:"GET",dataType:"json",data:{pesquisando:e},success:function(e){if(jQuery("#resultados tbody").empty(),jQuery("#linkPdf").attr("href",e.filename),e.success){var t=0;e.pesquisa.forEach(function(e){jQuery("#resultados tbody").append("<tr><td>"+e.nome+"</td><td>"+e.email+"</td><td>"+e.cpf+"</td><td>"+e.cep+"</td><td>"+e.telefone+"</td><td>"+e.data_nascimento+"</td><td>"+e.endereco+", "+e.bairro+", "+e.cidade+", "+e.estado+"</td><td> ver detalhes: "+e.id+"</td></tr>"),t++})}},error:function(e,t,d){console.error("Erro na requisição:",t,d)}})}console.log("carregado"),jQuery(document).ready(function(){jQuery("#pesquisa").on("input",function(){Pesquisar(jQuery(this).val())})});